CREATE TABLE SGDTEST.DCT_ASIG_ULTIMO
(
    IDE_ASIG_ULTIMO NUMBER(18) PRIMARY KEY NOT NULL,
    IDE_DOCUMENTO NUMBER(18) NOT NULL,
    IDE_AGENTE NUMBER(18) NOT NULL,
    IDE_ASIGNACION NUMBER(18) NOT NULL,
    IDE_USUARIO_CREO VARCHAR2(8) NOT NULL,
    FEC_CREO TIMESTAMP(6) NOT NULL,
    IDE_USUARIO_CAMBIO NUMBER(10) NOT NULL,
    FEC_CAMBIO TIMESTAMP(6) NOT NULL,
    NIV_LECTURA NUMBER(1) DEFAULT NULL
,
    NIV_ESCRITURA NUMBER(1) DEFAULT NULL
,
    FECHA_VENCIMIENTO TIMESTAMP(6) DEFAULT NULL
,
    ID_INSTANCIA VARCHAR2(50) DEFAULT NULL
,
    COD_TIP_PROCESO VARCHAR2(8) DEFAULT NULL
,
    NUM_REDIRECCIONES NUMBER(18),
    NUM_DEVOLUCIONES NUMBER(18),
    CONSTRAINT DCT_ASIG_ULTIMO_COR_AGEN_FK FOREIGN KEY (IDE_AGENTE) REFERENCES COR_AGENTE (IDE_AGENTE)
);
